func (ssq *StockSummaryQuery) querySpec() *sqlgraph.QuerySpec {
	_spec := sqlgraph.NewQuerySpec(stocksummary.Table, stocksummary.Columns, sqlgraph.NewFieldSpec(stocksummary.FieldID, field.TypeUint64))
	_spec.From = ssq.sql
	if unique := ssq.ctx.Unique; unique != nil {
		_spec.Unique = *unique
	} else if ssq.path != nil {
		_spec.Unique = true
	}
	if fields := ssq.ctx.Fields; len(fields) > 0 {
		_spec.Node.Columns = make([]string, 0, len(fields))
		_spec.Node.Columns = append(_spec.Node.Columns, stocksummary.FieldID)
		for i := range fields {
			if fields[i] != stocksummary.FieldID {
				_spec.Node.Columns = append(_spec.Node.Columns, fields[i])
			}
		}
		if ssq.withEnterprise != nil {
			_spec.Node.AddColumnOnce(stocksummary.FieldEnterpriseID)
		}
		if ssq.withStation != nil {
			_spec.Node.AddColumnOnce(stocksummary.FieldStationID)
		}
		if ssq.withStore != nil {
			_spec.Node.AddColumnOnce(stocksummary.FieldStoreID)
		}
		if ssq.withRider != nil {
			_spec.Node.AddColumnOnce(stocksummary.FieldRiderID)
		}
		if ssq.withCabinet != nil {
			_spec.Node.AddColumnOnce(stocksummary.FieldCabinetID)
		}
	}
	if ps := ssq.predicates; len(ps) > 0 {
		_spec.Predicate = func(selector *sql.Selector) {
			for i := range ps {
				ps[i](selector)
			}
		}
	}
	if limit := ssq.ctx.Limit; limit != nil {
		_spec.Limit = *limit
	}
	if offset := ssq.ctx.Offset; offset != nil {
		_spec.Offset = *offset
	}
	if ps := ssq.order; len(ps) > 0 {
		_spec.Order = func(selector *sql.Selector) {
			for i := range ps {
				ps[i](selector)
			}
		}
	}
	return _spec
}

func (ssq *StockSummaryQuery) sqlQuery(ctx context.Context) *sql.Selector {
	builder := sql.Dialect(ssq.driver.Dialect())
	t1 := builder.Table(stocksummary.Table)
	columns := ssq.ctx.Fields
	if len(columns) == 0 {
		columns = stocksummary.Columns
	}
	selector := builder.Select(t1.Columns(columns...)...).From(t1)
	if ssq.sql != nil {
		selector = ssq.sql
		selector.Select(selector.Columns(columns...)...)
	}
	if ssq.ctx.Unique != nil && *ssq.ctx.Unique {
		selector.Distinct()
	}
	for _, m := range ssq.modifiers {
		m(selector)
	}
	for _, p := range ssq.predicates {
		p(selector)
	}
	for _, p := range ssq.order {
		p(selector)
	}
	if offset := ssq.ctx.Offset; offset != nil {
		// limit is mandatory for offset clause. We start
		// with default value, and override it below if needed.
		selector.Offset(*offset).Limit(math.MaxInt32)
	}
	if limit := ssq.ctx.Limit; limit != nil {
		selector.Limit(*limit)
	}
	return selector
}

